import react from 'react';

function NavBar() {
    return (
      <div class=" sm:px-4 py-2.5 rounded bg-stone-800">
        <div class="mx-auto items-center">
          <span class="text-xl text-center font-semibold text-white">BeSpoked</span>
          <svg class="h-8 w-8 text-white"  width="24" height="24" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round">  <path stroke="none" d="M0 0h24v24H0z"/>  <circle cx="5" cy="18" r="3" />  <circle cx="19" cy="18" r="3" />  <polyline points="12 19 12 15 9 12 14 8 16 11 19 11" />  <circle cx="17" cy="5" r="1" /></svg>
        </div>
      </div>
    )
}

export default NavBar;
